create table enterprise
(
    id          bigint auto_increment
        primary key,
    account     varchar(255)                       null comment '账号',
    password    varchar(255)                       null comment '密码',
    name        varchar(255)                       null comment '企业名称',
    address     varchar(255)                       null comment '企业地址',
    manager     varchar(255)                       null comment '管理员',
    phone       varchar(11)                        null comment '电话',
    email       varchar(255)                       null comment '邮箱',
    create_time datetime default CURRENT_TIMESTAMP null comment '创建时间',
    update_time datetime                           null on update CURRENT_TIMESTAMP comment '更新时间',
    authorities varchar(255)                       null comment '角色权限',
    constraint enterprise_account_uindex
        unique (account)
)
    comment '企业用户表' charset = utf8;

create table environment
(
    id               bigint auto_increment
        primary key,
    air_temperature  decimal(6, 2)                      null comment '空气温度（单位：摄氏度）',
    air_humidity     decimal(6, 2)                      null comment '空气湿度：（单位：%）',
    co2              decimal(6, 2)                      null comment '二氧化碳浓度（单位：/10^-6)',
    illuminance      decimal(6, 2)                      null comment '光照度（单位：lx)',
    soil_temperature decimal(6, 2)                      null comment '土壤温度(单位：摄氏度）',
    soil_humidity    decimal(6, 2)                      null comment '土壤湿度（单位：%）',
    date             date                               null comment '日期',
    greenhouse_id    bigint                             null comment '大棚id',
    create_time      datetime default CURRENT_TIMESTAMP null comment '创建时间',
    update_time      datetime                           null on update CURRENT_TIMESTAMP comment '更新时间'
)
    collate = utf8mb4_general_ci;

create table environment_alert
(
    id               bigint auto_increment comment '主键id'
        primary key,
    air_temperature  decimal(6, 2)                        null comment '空气温度（单位：摄氏度）',
    air_humidity     decimal(6, 2)                        null comment '空气湿度：（单位：%）',
    co2              decimal(6, 2)                        null comment '二氧化碳浓度（单位：/10^-6)',
    illuminance      decimal(6, 2)                        null comment '光照度（单位：lx)',
    soil_temperature decimal(6, 2)                        null comment '土壤温度(单位：摄氏度）',
    soil_humidity    decimal(6, 2)                        null comment '土壤湿度（单位：%）',
    time             datetime                             null comment '时间',
    greenhouse_id    bigint                               null comment '大棚id',
    create_time      datetime   default CURRENT_TIMESTAMP null comment '创建时间',
    update_time      datetime                             null on update CURRENT_TIMESTAMP comment '更新时间',
    handled          tinyint(1) default 0                 null comment '是否已处理'
)
    collate = utf8mb4_general_ci;

create table environment_item
(
    id               bigint auto_increment
        primary key,
    air_temperature  decimal(6, 2)                      null comment '空气温度（单位：摄氏度）',
    air_humidity     decimal(6, 2)                      null comment '空气湿度：（单位：%）',
    co2              decimal(6, 2)                      null comment '二氧化碳浓度（单位：/10^-6)',
    illuminance      decimal(6, 2)                      null comment '光照度（单位：lx)',
    soil_temperature decimal(6, 2)                      null comment '土壤温度(单位：摄氏度）',
    soil_humidity    decimal(6, 2)                      null comment '土壤湿度（单位：%）',
    time             datetime                           null comment '时间',
    envn_id          bigint                             null comment '环境id',
    create_time      datetime default CURRENT_TIMESTAMP null comment '创建时间',
    update_time      datetime                           null on update CURRENT_TIMESTAMP comment '更新时间'
)
    collate = utf8mb4_general_ci;

create table environment_threshold
(
    id              bigint auto_increment
        primary key,
    air_temp_max    decimal(6, 2)                        null,
    air_temp_min    decimal(6, 2)                        null,
    air_hum_max     decimal(6, 2)                        null,
    air_hum_min     decimal(6, 2)                        null,
    co2_max         decimal(6, 2)                        null,
    co2_min         decimal(6, 2)                        null,
    illuminance_max decimal(6, 2)                        null,
    illuminance_min decimal(6, 2)                        null,
    soil_temp_max   decimal(6, 2)                        null,
    soil_temp_min   decimal(6, 2)                        null,
    greenhouse_id   bigint                               null,
    create_time     datetime   default CURRENT_TIMESTAMP null comment '创建时间',
    update_time     datetime                             null on update CURRENT_TIMESTAMP comment '更新时间',
    soil_humid_min  varchar(255)                         null,
    soil_humid_max  varchar(255)                         null,
    open            tinyint(1) default 0                 null comment '是否开启，1为开启，默认0'
)
    comment '环境因素阈值表' charset = utf8;

create table farm_produce
(
    id                 bigint auto_increment
        primary key,
    name               varchar(255)                       null comment '名称',
    greenhouse_id      int                                null comment '大棚id',
    intermediate_stage date                               null comment '中间阶段',
    finished_stage     date                               null comment '完成阶段',
    original_stage     date                               null comment '原始阶段',
    image              varchar(255)                       null comment '图像地址',
    create_time        datetime default CURRENT_TIMESTAMP null comment '创建时间',
    update_time        datetime                           null on update CURRENT_TIMESTAMP comment '更新时间'
)
    comment '农产品' charset = utf8;

create table greenhouse
(
    id            bigint auto_increment
        primary key,
    name          varchar(255)                       null comment '名称',
    image         varchar(255)                       null comment '图像地址',
    enterprise_id int                                null comment '企业id',
    create_time   datetime default CURRENT_TIMESTAMP null comment '创建时间',
    update_time   datetime                           null on update CURRENT_TIMESTAMP comment '更新时间'
)
    comment '大棚表' charset = utf8;

create table oauth_client_details
(
    client_id               varchar(48)   not null comment '客户端ID，主要用于标识对应的应用'
        primary key,
    resource_ids            varchar(256)  null,
    client_secret           varchar(256)  null comment '客户端秘钥，BCryptPasswordEncoder加密',
    scope                   varchar(256)  null comment '对应的范围',
    authorized_grant_types  varchar(256)  null comment '认证模式',
    web_server_redirect_uri varchar(256)  null comment '认证后重定向地址',
    authorities             varchar(256)  null comment '权限',
    access_token_validity   int           null comment '令牌有效期',
    refresh_token_validity  int           null comment '令牌刷新周期',
    additional_information  varchar(4096) null,
    autoapprove             varchar(256)  null
)
    charset = utf8;

create table trace
(
    id               bigint auto_increment
        primary key,
    qrcode           varchar(255) default 'http://cdn.oeong.com/niu20220514123442.png' null comment '溯源码',
    produce_id       bigint                                                            null comment '农产品id',
    enterprise_id    bigint                                                            null comment '企业id',
    greenhouse_id    bigint                                                            null comment '大棚id',
    nurture_worker   varchar(255)                                                      null comment '培育人员',
    product_worker   varchar(255)                                                      null comment '生产人员',
    quality_worker   varchar(255)                                                      null comment '质检人员',
    transport_worker varchar(255)                                                      null comment '运输人员',
    update_time      datetime                                                          null on update CURRENT_TIMESTAMP comment '更新时间',
    create_time      datetime     default CURRENT_TIMESTAMP                            null comment '创建时间'
)
    comment '溯源表' charset = utf8;

